    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Florida Panther NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how the Refuge will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, information about the management direction,
    and strategies for implementation. Key planning issues include: public access, Cooperative
    Land Management, public awareness, panther habitat protection, Refuge research and
    management, staffing, and oil exploration.",nt"license_title": "License Not
